import React from "react";
import SearchBar from "./SearchBar";
import "./styles/NavBar.css";

export default function NavBar({ onSearch }) {
  return (
    <div className="nav">
      <SearchBar onSearch={onSearch} />
      <div>
        <button onClick={() => onSearch()}>Agregar Personaje Random</button>
      </div>
    </div>
  );
}
